pub enum CustomExpression { Literal(i32),
} impl ScriptExpression for CustomExpression { fn evaluate(&self, context: &mut Context, _: &Registry) { match self { Self::Literal(value) => { context.stack().push(*value); } } }
} Expressions allow to extend available operations set of Intuicio scripts to enable features specific to given frontend - here we just allow to push i32 literals onto stack. Now we will define intermediate script types for our Custom scripting language: pub type CustomScript = Vec<CustomOperation>; pub enum CustomOperation { Comment { content: String }, Push { value: i32 }, Call { name: String, module_name: String },
} Next we need to implement parsing of operations from string lines to intermediate script data: impl FromStr for CustomOperation { type Err = CustomOperationError; fn from_str(line: &str) -> Result<Self, Self::Err> { let line = line.trim(); if line.is_empty() { return Ok(Self::Comment { content: "".to_owned(), }); } if line.starts_with("#") { return Ok(Self::Comment { content: line.to_owned(), }); } let mut tokens = line.split_ascii_whitespace(); match tokens.next() { Some("push") => { let value = tokens.next().unwrap().parse::<i32>().unwrap(); Ok(Self::Push { value }) } Some("call") => { let module_name = tokens.next().unwrap().to_owned(); let name = tokens.next().unwrap().to_owned(); Ok(Self::Call { name, module_name }) } _ => Err(CustomOperationError { operation: line.to_owned(), }), } }
} Also don't forget to implement our parsing error type: #[derive(Debug)]
pub struct CustomOperationError { pub operation: String,
} impl std::fmt::Display for CustomOperationError { fn fmt(&self, f: &mut std::fmt::Formatter<'_>) -> std::fmt::Result { write!(f, "Unsupported operation: `{}`", self.operation) }
} impl Error for CustomOperationError {} After that we need to implement script compilation from intermediate to Intuicio scripts data, so scripts will be understood by Intuicio backend: impl CustomOperation { pub fn compile_operation(&self) -> Option<ScriptOperation<'static, CustomExpression>> { match self { Self::Comment { .. } => None, Self::Push { value } => Some(ScriptOperation::Expression { expression: CustomExpression::Literal(*value), }), Self::Call { name, module_name } => Some(ScriptOperation::CallFunction { query: FunctionQuery { name: Some(name.to_owned().into()), module_name: Some(module_name.to_owned().into()), ..Default::default() }, }), } } pub fn compile_script( operations: &[CustomOperation], ) -> ScriptHandle<'static, CustomExpression> { operations .iter() .rev() .filter_map(|operation| operation.compile_operation()) .collect::<Vec<_>>() .into() }
