Let's start with showing how our add function actually looks like to Host: fn add(context: &mut Context, registry: &Registry) { let a = context.stack().pop::<i32>().unwrap(); let b = context.stack().pop::<i32>().unwrap(); let result = a + b; context.stack().push(result);
} Now from the example above we can see that execution starts from application-space when we tell Host to find main function of test module in host's registry, once is found, host passes its Context and Registry to function generated from script. This is how test::main script function would look like to Host when converted to Rust: fn main(context: &mut Context, registry: &Registry) { context.stack().push(40_i32); context.stack().push(2_i32); registry .find_function(FunctionQuery { name: Some("add".into()), module_name: Some("lib".into()), ..Default::default() }) .unwrap() .invoke(context, registry);
} So both together simply reduce to: fn main(context: &mut Context, registry: &Registry) { context.stack().push(40_i32); context.stack().push(2_i32); add(context, registry);
} And this is basically exactly how and why Intuicio doesn't care about which side (script or native) calls what side - both script and native sides are calling each other the same way, and VmScope is just a container for script operations in the middle of interactions to make script side look the same as native side to host - this opens quite interesting opportunity, if expression type matches, to use different frontends together in one application. You can think of it as something like .NET platform for Rust.
